window.bookSummaryJSON = "<p>Darrow returns as Pierce Brown’s New York Times bestselling Red Rising series continues in the thrilling sequel to Dark Age.</p> <p>“The measure of a man is not the fear he sows in his enemies. It is the hope he gives his friends.”—Virginia au Augustus</p> <p>The Reaper is a legend, more myth than man: the savior of worlds, the leader of the Rising, the breaker of chains.</p> <p>But the Reaper is also Darrow, born of the red soil of Mars: a husband, a father, a friend.</p> <p>The worlds once needed the Reaper. But now they need Darrow. Because after the dark age will come a new age: of light, of victory, of hope.</p> <p>Don’t miss any of Pierce Brown’s Red Rising Saga:</p> <p>RED RISING • GOLDEN SON • MORNING STAR • IRON GOLD • DARK AGE • LIGHT BRINGER</p>"; 
